.storybook-button {
  font-family: 'Nunito Sans', 'Helvetica Neue', Helvetica, Arial, sans-serif;
  font-weight: 700;
  border: 0;
  border-radius: 3em;
  cursor: pointer;
  display: inline-block;
  line-height: 1;
}
.storybook-button:active {
  /* :active是滑鼠點擊元素的狀態 */
  transform: scale(1);
  box-shadow: inset 0 0 10px 1px #00000033;
  opacity: 0.6;
}
.primary {
  color: white;
  background-color: #1ea7fd;
}
.secondary {
  color: #333;
  background-color: #eeaca3;
  box-shadow: rgba(0, 0, 0, 0.15) 0px 0px 0px 1px inset;
}
.small {
  font-size: 12px;
  padding: 10px 16px;
}
.medium {
  font-size: 14px;
  padding: 11px 20px;
}
.large {
  font-size: 16px;
  padding: 12px 24px;
}
.disable {
  background-color: #cccccc;
  color: #666666;
}

